// TODO: Connect Airtable API with this to bring in startups dynamically
// TODO: Add styling, startup logos, query params for each mentor/startup
import React from 'react';

const StartupList = (props) => (
  <div className='startup-list'>
    <div className='each-startup'>
      <h1 className='startup-name'>{startup.name}</h1>
      <p className='startup-location'>{startup.location} </p>
      <h3 className='startup-description'>{startup.description}</h3>
      <label htmlFor=''>Yes</label>
      <input
        type='radio'
        value='yes'
        name={name}
        onChange={handleChange}
        className='mentor-choice'
      />
      <label htmlFor=''>No</label>
      <input
        type='radio'
        value='no'
        name={name}
        onChange={handleChange}
        className='mentor-choice'
      />
    </div>
  </div>
);

export default StartupList;
